Create node with no relationships To create a new Project node by itself: mutation { ProjectCreate( input: { name: "Project 1", status: "ACTIVE" } ) { id name }
} Output: { "data": { "ProjectCreate": { "id": "a55e1dae-a87f-4ca1-8724-b967a678b942", "name": "Project 1" } }
} Create node with relationship to a NEW node To create a new Project node with an owner relationship to a new User node: mutation { ProjectCreate( input: { name: "Project 2", status: "ACTIVE", owner: { dst: { User: { $NEW: { name: "Smith" } } } } } ) { ... }
} Create node with relationship to an EXISTING node To create a new Project node with an owner relationship to an existing User node: mutation { ProjectCreate( input: { name: "Project 3", status: "ACTIVE", owner: { dst: { User: { $EXISTING: { name: "Oneill" } } } } } ) { ... }
}

11.body:
Update props on node with matching props To update the status of the Project node with name == "Project 2": mutation { ProjectCreate( input: { $MATCH: { name: "Project 2" }, $SET: { status: "INACTIVE" } } ) { ... }
} Update props on node with a relationship to a node containing matching props To update the status of any Project nodes containing an owner relationship to the User with name == "Smith": mutation { ProjectCreate( input: { $MATCH: { owner: { dst: { User: { name: "Smith" } } } }, $SET: { status: "INACTIVE" } } ) { ... }
} Update node to add (multi-node) relationships To update a specific Project node to add several issue relationships to new Feature and Bug nodes, call ProjectUpdate with: mutation { ProjectUpdate( input: { $MATCH: { id: "<ID>" }, $SET: { issues: [ { $ADD: { dst: { Feature: { $NEW: { name: "Add login page" } } } } }, { $ADD: { dst: { Bug: { $NEW: { name: "Fix auth bug" } } } } } ] } } ) { ... }
}

