Navigate to the displayed URL. You should see the GraphQL Playground which allows you to interact directly with the API. List all Users First, list all User nodes in the database: query { User { id email }
} You should expect to see an empty list since the database is empty: { "data": { "User": [] }
} Create a new User Next, create a new user: mutation { UserCreate(input: { email: "user@example.com" }) { id email }
} The response should display the newly created user: { "data": { "UserCreate": { "email": "user@example.com", "id": "0b2a6753-a5cf-46ea-b046-4935ea208950" } }
} (Your id will of course differ). Create a new Team Now, create a Team node: mutation { TeamCreate(input: { name: "Blue Team" }) { id name }
} Like before, you should see the newly created Team node: { "data": { "TeamCreate": { "id": "d381a0f7-8a01-49e3-80ff-15ba01f3604f", "name": "Blue Team" } }
} Add User to Team GraphQL and Neo4j are all about relationships. Finally, create a relationship between the Team and User nodes: mutation { TeamUsersCreate(input: { match: { name: "Blue Team" }, create: { dst: { User: { EXISTING: { email: "user@example.com" } } } } }) { id }
} { "data": { "Team": [ { "id": "e5d5e19a-70bf-4d04-b32f-e61407100914", "name": "Blue Team", "users": { "dst": { "email": "user@example.com", "id": "0b2a6753-a5cf-46ea-b046-4935ea208950" } } } ] }
}

